import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Card from "./component/Card";

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      loading: false,
      character: {}
    };
  }

  componentDidMount() {
    this.setState({ loading: true });
    fetch(
      "https://v2-api.sheety.co/69072a59b5982e9dd27aaa5bf290e8c6/colorsnt/data/3"
    )
      .then(response => response.json())
      .then(data => {
        this.setState({
          loading: false,
          character: data
        });
      });
  }

  render() {
    const { items } = this.state;
    console.log(this.state.character);
    return (
      <div>
        <ul>
          {items.map(item => (
            <li key={item.name}>
              {item.name} {item.price}
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

export default App;
